import React from "react";
import { Link, Outlet } from "react-router-dom";

const Homepage = () => {
  return (
    <div>
      WELCOME TO BACEFOOK MOTHERFUCKER
      <nav id="navbar">
        <Link className="navitem" to="AboutMe">
          About Me Bitch
        </Link>
        <Link className="navitem" to="Payment">
          Payment
        </Link>
        <Link className="navitem" to="Register">
          Register
        </Link>
      </nav>
      <Outlet />
    </div>
  );
};

export default Homepage;
